import React from "react";
import GroupAddOutlinedIcon from "@mui/icons-material/GroupAddOutlined";

export function DrawerItem() {
  const Item = [
    {
      title: "SignUp",
      icon: <GroupAddOutlinedIcon />,
    },
    {
      title: "Client",
      icon: <GroupAddOutlinedIcon />,
    },
    {
      title: "Server",
      icon: <GroupAddOutlinedIcon />,
    },
  ];
  return <div></div>;
}

export default DrawerItem;
